import ContractPreview from "./components#/preview.vue";
import { EditService } from "./edit.service.ts";
import { MessageService } from '@/services/message.service';
import ContractConstitution from '@/views/biz-modals/contract/constitution';
var pageName = 'page-setting-contract-edit';
export default {
  name: pageName,
  components: {
    ContractPreview: ContractPreview
  },
  bem: {
    bPage: pageName,
    bSider: "".concat(pageName, "-sider"),
    bMain: "".concat(pageName, "-main")
  },
  modals: {
    ContractConstitution: ContractConstitution
  },
  serviceInject: function serviceInject() {
    return {
      editService: EditService,
      message: MessageService
    };
  },
  rxState: function rxState() {
    /**
     * @type {EditService}
     */
    var edit = this.editService;
    return {
      info: edit.info$,
      codeRules: edit.codeRules$,
      lawContent: edit.lawContent$,
      codeDemo: edit.codeDemo$,
      loading: edit.loading$
    };
  },
  methods: {
    onCodeDone: function onCodeDone() {
      this.editService.getCodeInfo().subscribe();
    },
    onLawContentDone: function onLawContentDone() {
      this.editService.getConstitutionInfo().subscribe();
    },
    onPageTypeChange: function onPageTypeChange(e) {
      if (e.target.value === 0) {
        this.info.contract_page = 100;
      }
    },
    onPageMargetChange: function onPageMargetChange(e) {
      if (e.target.value === 0) {
        this.info.contract_marget = 20;
      }
    },
    onUpdateContract: function onUpdateContract() {
      var _this = this;

      this.editService.updateContract(this.info).subscribe(function () {
        _this.message.success({
          content: '保存合同模版成功！'
        });
      });
    }
  }
};
